import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import TextField from "@material-ui/core/TextField";
import { alpha } from "@material-ui/core/styles";

import logo from "../React/titlelog.png";
import "./SignUp.scss";


const useStylesReddit = makeStyles((theme) => ({
  root: {
    border: "1px solid #e2e2e1",
    overflow: "hidden",
    marginBottom: "10px",
    borderRadius: 4,
    backgroundColor: "#1d2630",
    transition: theme.transitions.create(["border-color", "box-shadow"]),
    color:'red',
    "&:hover": {
      backgroundColor: "#fff"
    },
    "&$focused": {
      backgroundColor: "#fff",
      boxShadow: `${alpha(theme.palette.primary.main, 0.25)} 0 0 0 2px`,
      borderColor: "yellow",
      color: "green"
    }
  },
  focused: {}
}));

const useStyles = makeStyles((theme) => ({
  // root: {
  //   '& > *': {
  //     margin: theme.spacing(1),
  //     width: '35ch',
  //   },
  // },
  // input3: {
  //   width: "100%",
  //   // height:"50px",
  //   backgroundColor: "#1d2630",
  //   // padding:"1px 1px",
  //   borderRadius: "5px",
  //   marginBottom: "10px",
  //   color: "white",
  // },
}));

const SignUp = () => {
  const classes = useStyles();
  const class2 = useStylesReddit();
  return (
    <>
      <div className="main_container">
        <div className="centrel_div">
          <div className="img">
            <img className="logo_img" src={logo} alt="Error" />
          </div>
          <div className="heading">
            <h3 className="heading_title">Entre Your Details</h3>
          </div>
          <div className="inputs">
            <TextField
              id="filled-basic"
              label="Full Name"
              variant="outlined"
              className={classes.input3}
            />
            {/* <input
           type="text"
            name="Last Name"
            className="input2"
            placeholder="Last Name" /> */}
            <TextField
              id="filled-basic"
              label="Email Adress"
              variant="outlined"
              className={classes.input3}
            />
            <TextField
              id="filled-basic"
              label="Password"
              variant="outlined"
              className={class2.root}
            />
            <TextField
              className={classes.input3}
              id="filled-basic"
              label="Confirm Password"
              variant="outlined"
            />
            <div className="button">
              <button className="submit">CONTINUE</button>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default SignUp;
